inline Sound LoadSoundFromMemory(const uint8_t* data, int size) {
    if (!data || size <= 0)
    {
        std::cerr << "LoadSoundFromMemory: Invalid data or size." << std::endl;
        return { 0 };
    }

    Wave wave = LoadWaveFromMemory(".wav", data, size);
    if (wave.data == nullptr) 
    {
        std::cerr << "LoadSoundFromMemory: Failed to load wave from memory." << std::endl;
        return { 0 };
    }

    std::cout << "Wave Format: "
        << wave.sampleRate << " Hz, "
        << wave.sampleSize << " bits, "
        << wave.channels << " channels"
        << std::endl;


    Sound sound = LoadSoundFromWave(wave);
    UnloadWave(wave); 
    return sound;
}


